buffer = ''

for i in range(13, len(buffer)):
    word = buffer[i-13:i+1]
    counter = {}
    for letter in word:
        if letter not in counter:
            counter[letter] = 0
        counter[letter] = counter[letter] + 1

    #print(counter)

    no_duplicates_found = False
    for letter in counter:
        if counter[letter]==1:
            no_duplicates_found = True
        else:
            no_duplicates_found = False
            break

    if no_duplicates_found:
        break

print(i+1)
